    false,nt"url": null,nt"notes": "This database contains locations of day
    care centers for 50 states and Washington D.C. and Puerto Rico. The dataset only
    includes center based day care locations (including schools and religious institutes)
    and does not include group, home, and family based day cares. All the data was acquired
    from respective states departments or their open source websites. Information on
    the source of data for each state is available in the database itself. After geocoding
    the exact spatial location of each point was moved to rooftops wherever possible
    and points which have been physically verified have been labelled Geocode, Imagery,
    Imagery with other, and Unverified depending on the methodology used to move the
    points. 'Unverified' data points have still not been physically examined even though
    each of the points has been street geocoded as mentioned above. The TYPE attribute
    is a common classification of day care for all states which classifies every day
    care into Center Based, School Based, Head Start, or Religious Facility. Missing
    records are denoted by 'Not Available' or NULL values.Not Available denotes information
    that was either missing in the source data or data that has not been populated current
    version.",nt"license_title": "License Not Specified",nt"extras": [{ntt"key":
